import logo from './logo.svg';
import './App.css';
import {createContext, useState} from "react";
import Body from './components/Body';
import Header from './components/Header';

// export the context
export const UserContext = createContext();
function App() {
  let arr = {
    0: {
      "text":"Hello world",
      "img":"data:image/jpeg;base64,"
    },
    1: {
      "text":"السلام عليكم ورحمةالله وبركاتة",
      "img":"data:image/jpeg;base64,"
    },
    2: {
      "text":"こんにちは世界",
      "img":"data:image/jpeg;base64,"
    }}
  const [content, setContent] = useState([]);



  const Eng = () => {
      let txt =arr[0].text
      let img = arr[0].img
    setContent({txt,img})
  };
  const arabic = () => {
    let txt =arr[1].text
    let img = arr[1].img
    setContent({txt,img})
  };
  const japan = () => {
    let txt =arr[2].text
    let img = arr[2].img
    setContent({txt,img})
  };
  return (
    <UserContext.Provider value={content}>
      <div className="page">
      <div className="buttonDesign">
        <button onClick={Eng}>English</button>
        <button onClick={arabic}>Arabic</button>
        <button onClick={japan}>Japan</button>
      </div>
        <Body/>
        <Header/>
      </div>
    </UserContext.Provider>
  );
}

export default App;
